import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Heading, 
  SimpleGrid, 
  Button, 
  Flex,
  Input,
  InputGroup,
  InputLeftElement,
  Spinner,
  Text,
  useToast
} from '@chakra-ui/react';
import { SearchIcon, AddIcon } from '@chakra-ui/icons';
import { useExpeta } from '../context/ExpetaContext';
import { useNavigate } from 'react-router-dom';

const ExpectationsPage = () => {
  const { expectations, loadExpectations, loading, error } = useExpeta();
  const [searchQuery, setSearchQuery] = useState('');
  const [filteredExpectations, setFilteredExpectations] = useState([]);
  const navigate = useNavigate();
  const toast = useToast();

  useEffect(() => {
    // Filter expectations based on search query
    if (expectations && expectations.length > 0) {
      const filtered = expectations.filter(exp => 
        exp.name?.toLowerCase().includes(searchQuery.toLowerCase()) || 
        exp.description?.toLowerCase().includes(searchQuery.toLowerCase())
      );
      setFilteredExpectations(filtered);
    } else {
      setFilteredExpectations([]);
    }
  }, [searchQuery, expectations]);

  const handleRefresh = async () => {
    try {
      await loadExpectations();
      toast({
        title: 'Expectations refreshed',
        status: 'success',
        duration: 2000,
        isClosable: true
      });
    } catch (err) {
      toast({
        title: 'Error refreshing expectations',
        description: err.message,
        status: 'error',
        duration: 3000,
        isClosable: true
      });
    }
  };

  const handleViewExpectation = (id) => {
    navigate(`/expectations/${id}`);
  };

  const handleGenerateCode = (id) => {
    // Navigate to code generation page or trigger code generation
    // For demo, just navigate to the expectation detail
    navigate(`/expectations/${id}`);
  };

  return (
    <Box>
      <Flex justify="space-between" align="center" mb={6}>
        <Heading size="lg">Expectations</Heading>
        <Button 
          leftIcon={<AddIcon />} 
          colorScheme="blue"
          onClick={() => navigate('/create-expectation')}
        >
          New Expectation
        </Button>
      </Flex>

      <Box mb={6}>
        <InputGroup>
          <InputLeftElement pointerEvents="none">
            <SearchIcon color="gray.300" />
          </InputLeftElement>
          <Input 
            placeholder="Search expectations..." 
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
        </InputGroup>
      </Box>

      {loading.expectations ? (
        <Flex justify="center" align="center" my={10}>
          <Spinner size="xl" />
          <Text ml={4}>Loading expectations...</Text>
        </Flex>
      ) : error.expectations ? (
        <Box p={4} bg="red.50" color="red.500" borderRadius="md">
          {error.expectations}
        </Box>
      ) : filteredExpectations.length === 0 ? (
        <Box p={10} textAlign="center" bg="gray.50" borderRadius="md">
          <Text mb={4}>No expectations found</Text>
          <Button colorScheme="blue" onClick={handleRefresh}>
            Refresh
          </Button>
        </Box>
      ) : (
        <SimpleGrid columns={{ base: 1, md: 2, lg: 3 }} spacing={6}>
          {/* Placeholder for expectation cards */}
          {filteredExpectations.map((expectation) => (
            <Box 
              key={expectation.id}
              p={5}
              shadow="md"
              borderWidth="1px"
              borderRadius="md"
              bg="white"
              onClick={() => handleViewExpectation(expectation.id)}
              cursor="pointer"
              _hover={{ shadow: "lg" }}
            >
              <Heading fontSize="xl" mb={2}>{expectation.name}</Heading>
              <Text noOfLines={2} mb={4}>{expectation.description}</Text>
              <Button 
                size="sm" 
                colorScheme="blue"
                onClick={(e) => {
                  e.stopPropagation();
                  handleGenerateCode(expectation.id);
                }}
              >
                Generate Code
              </Button>
            </Box>
          ))}
        </SimpleGrid>
      )}
    </Box>
  );
};

export default ExpectationsPage;
